import React from 'react';
import { FaEnvelope, FaLinkedin, FaTwitter, FaFacebook, FaInstagram, FaGithub } from 'react-icons/fa';

const SocialMediaIcons = () => {
  return (
    <div style={{ display: 'flex', justifyContent: 'space-around', width: '300px', margin: 'auto' }}>
      <a href="mailto:youremail@example.com" target="_blank" rel="noopener noreferrer">
        <FaEnvelope size={30} />
      </a>
      <a href="https://www.linkedin.com/in/yourprofile" target="_blank" rel="noopener noreferrer">
        <FaLinkedin size={30} />
      </a>
      <a href="https://twitter.com/yourprofile" target="_blank" rel="noopener noreferrer">
        <FaTwitter size={30} />
      </a>
      <a href="https://www.facebook.com/yourprofile" target="_blank" rel="noopener noreferrer">
        <FaFacebook size={30} />
      </a>
      <a href="https://www.instagram.com/yourprofile" target="_blank" rel="noopener noreferrer">
        <FaInstagram size={30} />
      </a>
      <a href="https://github.com/yourprofile" target="_blank" rel="noopener noreferrer">
        <FaGithub size={30} />
      </a>
    </div>
  );
};

export default SocialMediaIcons;
